import React from "react";

import { Routes, Route } from "react-router-dom";

import Google_MapApi_Script from "./Google_API_In_Use/Google_MapApi_Script";

export const Google_Api_Integrater = () =>{

    return <React.Fragment>
        
        <Routes>
        <Route path="/" element={
            <Google_MapApi_Script/>
        }>

        </Route>
        </Routes>
        </React.Fragment>

}

export default Google_Api_Integrater;
